import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter as Router } from 'react-router-dom';
import Routes from './Routes';
import Home from "./home";

ReactDOM.render(
    <Router>
        <div className="App">
            <Home/>
            <Routes />
        </div>
    </Router>,
    document.getElementById('root')
);
